 import React, {Fragment} from 'react';



const Header = () => {
    return ( 
      <fragment>

     <div className="row">
         <div className="col">
             <h1 className="h1">Soy el Header</h1>
         </div>
     </div>

    </fragment> 

    );
}

export default Header;
